import React from 'react'
import MaterialTable from 'material-table';
import { Button, Dialog, DialogActions, DialogContent } from '@material-ui/core';
import { DialogTitle } from '@mui/material';

import Icon from '@mui/material/Icon';
import CreateIcon from '@mui/icons-material/Create';
import DeleteIcon from '@mui/icons-material/Delete';

export default function PaddockTable() {
    const [open, setOpen] = React.useState(false);
    const handleClickOpen = () => {
        setOpen(true);
    };
    const handleClose = (event, reason) => {
        setOpen(false);

    };

    const [data, setData] = React.useState([
        { name: 'Linta Paddock', size: '23ac', cultivar: 'abc', rotation: 'Defective Grains, Foreign Material', year: '2019' },
        { name: 'K2K Paddock', size: '50ac', cultivar: 'dfg', rotation: 'Defective Grains,Oil, Purity', year: '2019' },
        { name: 'Harry Woods Paddock', size: '40ac', cultivar: 'hij', rotation: 'Heat Damage, Impurities', year: '2019' },
        { name: 'Peter Dein Co.', size: '10ac', cultivar: 'abc', rotation: 'Defective Grains, Heat Damage', year: '2019' }
         ])
    const columns = [{
        title: 'Name', field: 'name'
    },
    {
        title: 'Size', field: 'size'
    }, {
        title: 'Cultivar', field: 'cultivar'
    }, {
        title: 'Rotation', field: 'rotation'
    }, {
        title: 'Year', field: 'year'
    }]
    return (
        <div>
            <MaterialTable title="Paddocks"
                data={data}
                columns={columns}
                editable={{
                    onRowDelete: oldData =>
                        new Promise((resolve, reject) => {
                            setTimeout(() => {
                                const dataDelete = [...data];
                                const index = oldData.tableData.id;
                                dataDelete.splice(index, 1);
                                setData([...dataDelete]);
                                resolve()
                            }, 1000)
                        }),
                }}
                actions={[
                    {
                        icon: () => <Icon sx={{ fontSize: 40 }} color="info">add_circle</Icon>,
                        isFreeAction: true,
                        onClick: (event) => setOpen(true)
                    },
                    {
                        icon: () => <Icon sx={{ fontSize: 22 }} color="action"><CreateIcon /></Icon>,
                        tooltip: 'Save User',
                        onClick: (event, rowData) => setOpen(true)
                    }
                ]}
                options={{
                    actionsColumnIndex: -1
                }}
            /> {/*--------------------------------------------Completed jobs popup---------------------
            <Dialog open={open} onClose={handleClose} maxWidth="sm" scroll="paper">
                <DialogTitle sx={{ fontSize: 24, fontWeight: 'large' }}>New Item</DialogTitle>
                <DialogContent>
                    <Cultivarsmain />
                </DialogContent>
                <DialogActions>
                    <Button onClick={handleClose} color="primary">CANCEL</Button>
                    <Button onClick={handleClose} color="primary">SAVE</Button>
                </DialogActions>
            </Dialog>-*/}
        </div>
    )
}
